import React from 'react';
import "../card.css";
import useFetch from "./useFetch";
import data from "../data.json"




export default function Card() {

  const [data] = useFetch("../data.json")
  return (
   data && data.map((data) => {
      return (
        
 <div className="container" >
      <div className='card card1'>
        <img src={data.logo} alt="img" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
                <span>{data.company}</span> <span>{data.new}</span> <span>{data.featured}</span>
          </div>

          <div className="title">
            <h4>{data.position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{ data.postedAt + " - "}</span> <span>{data.contract + " - "}</span> <span>{data.location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{data.role}</span>  <span>{data.level}</span>  <span>{data.languages}</span>
        </div>

      </div >

    </div>
      )
    })
   
  );
}
